import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import authService from "../../services/authService";

const Login = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    email: "",
    password: "",
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await authService.login(form);
      console.log("‚úÖ LOGIN RESULT:", res.data);

      const loginData = res.data;

      // ‚úÖ ƒê·∫¢M B·∫¢O LU√îN C√ì TOKEN
      if (!loginData.token) {
        throw new Error("No token received from server");
      }

      // ‚úÖ L∆ØU TOKEN TR∆Ø·ªöC TI√äN
      localStorage.setItem("token", loginData.token);
      console.log("üîê Token saved:", loginData.token);

      // ‚úÖ X·ª¨ L√ù USER DATA - ƒê∆†N GI·∫¢N H√ìA
      let userToStore = {
        email: form.email,
        first_name: "",
        last_name: ""
      };

      // TR∆Ø·ªúNG H·ª¢P 1: C√≥ ƒë·∫ßy ƒë·ªß user info t·ª´ login response
      if (loginData.user_id || loginData.userId) {
        userToStore.userId = loginData.user_id || loginData.userId;
        userToStore.first_name = loginData.first_name || loginData.firstName || "";
        userToStore.last_name = loginData.last_name || loginData.lastName || "";

        console.log("üíæ Saving user from login response:", userToStore);
      }
      // TR∆Ø·ªúNG H·ª¢P 2: Ch·ªâ c√≥ userId, c·∫ßn fetch th√™m th√¥ng tin
      else if (loginData.userId) {
        userToStore.userId = loginData.userId;

        // G·ªçi API ƒë·ªÉ l·∫•y th√¥ng tin user ƒë·∫ßy ƒë·ªß (n·∫øu c·∫ßn)
        try {
          // S·ª≠ d·ª•ng authService ho·∫∑c userService n·∫øu c√≥
          const userRes = await authService.getUserProfile(loginData.userId);
          if (userRes.data) {
            userToStore.first_name = userRes.data.first_name || userRes.data.firstName || "";
            userToStore.last_name = userRes.data.last_name || userRes.data.lastName || "";
          }
        } catch (profileError) {
          console.warn("‚ö†Ô∏è Could not fetch user profile, using basic info:", profileError);
        }
      }
      // TR∆Ø·ªúNG H·ª¢P 3: Kh√¥ng c√≥ user info - t·∫°o t·∫°m th·ªùi
      else {
        console.warn("‚ö†Ô∏è No user info in login response, creating temporary user");
        userToStore.userId = `temp_${Date.now()}`;
      }

      // ‚úÖ L∆ØU USER DATA
      localStorage.setItem("user", JSON.stringify(userToStore));
      console.log("üë§ User data saved:", userToStore);

      // ‚úÖ KI·ªÇM TRA L·∫†I TR∆Ø·ªöC KHI CHUY·ªÇN TRANG
      const savedToken = localStorage.getItem("token");
      const savedUser = localStorage.getItem("user");

      console.log("üîç FINAL CHECK - Storage:", {
        token: savedToken ? `EXISTS (${savedToken.length} chars)` : "MISSING",
        user: savedUser ? JSON.parse(savedUser) : "MISSING"
      });

      if (!savedToken) {
        throw new Error("Token was not saved properly");
      }

      alert("‚úÖ ƒêƒÉng nh·∫≠p th√†nh c√¥ng!");

      // ‚úÖ CHUY·ªÇN TRANG SAU KHI ƒê·∫¢M B·∫¢O ƒê√É L∆ØU D·ªÆ LI·ªÜU
      setTimeout(() => {
        window.location.href = "/"; // Reload ƒë·ªÉ c·∫≠p nh·∫≠t Header
      }, 500);

    } catch (err) {
      console.error("‚ùå LOGIN ERROR:", err);

      // X√≥a d·ªØ li·ªáu l·ªói
      localStorage.removeItem("token");
      localStorage.removeItem("user");

      alert("‚ùå ƒêƒÉng nh·∫≠p th·∫•t b·∫°i! " + (err.response?.data?.message || err.message));
    }
  };

  return (
    <div className="card mx-auto" style={{ maxWidth: "380px", marginTop: "100px" }}>
      <div className="card-body">
        <h4 className="card-title mb-4">Sign in</h4>

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <input
              name="email"
              className="form-control"
              placeholder="Email"
              type="email"
              value={form.email}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <input
              name="password"
              className="form-control"
              placeholder="Password"
              type="password"
              value={form.password}
              onChange={handleChange}
              required
            />
          </div>

          <button type="submit" className="btn btn-primary btn-block">
            Login
          </button>
        </form>
      </div>
    </div>
  );
};

export default Login;
